import { Routes, Route } from "react-router-dom";

const App = () => {
  return (
    <>
      <Routes>
        <Route path="/" Component={Home} /> 
        <Route path="/about" Component={About} /> 
        <Route path="/service" Component={Service} /> 
        <Route path="/contact" Component={Contact} /> 
      </Routes>
    </>
  );
};

export default App;
